contracts/AnonymousVoting.sol.content:
pragma solidity ^0.8.27;

import "./VotingCore.sol";

contract AnonymousVoting is VotingCore {

    mapping(bytes32 => bool) private hasVotedHash;
    bytes32[] public voters;

   constructor(address _creator) VotingCore(_creator) {}

    function newVoting() public {
        require(msg.sender == owner, "Only the owner can create a new voting instance.");

        for (uint256 i = 0; i < voters.length; i++) {
            hasVotedHash[voters[i]] = false;
        }
        delete voters;
    }

    function vote(uint optionIndex) public payable override {
        require(isVotingActive, "The voting session is not active.");
        require(optionIndex < options.length, "Invalid option.");
        require(msg.value == 0.01 ether, "Please pay exactly 0.01 ethers");
        require(block.timestamp < votingEndTime, "The voting session has ended.");

        bytes32 voterHash = keccak256(abi.encodePacked(msg.sender));
        require(!hasVotedHash[voterHash], "You have already voted.");

        options[optionIndex].voteCount += 1;
        hasVotedHash[voterHash] = true;
        voters.push(voterHash);
        emit VotedCast(optionIndex);
    }

    function getVotingType() public pure returns (string memory) {
        return "Anonymous";
    }
}

contracts/PublicVoting.sol.content:
pragma solidity ^0.8.27;

import "./VotingCore.sol";

contract PublicVoting is VotingCore {
    
    mapping(address => bool) public hasVoted;
    address[] public voters;

   constructor(address _creator) VotingCore(_creator) {}

    function newVoting() public {
        require(msg.sender == owner, "Only the owner can create a new voting instance.");

        for (uint256 i = 0; i < voters.length; i++) {
            hasVoted[voters[i]] = false;
        }
        delete voters;
    }

    function vote(uint optionIndex) public payable override {
        require(isVotingActive, "The voting session is not active.");
        require(optionIndex < options.length, "Invalid option.");
        require(msg.value == 0.01 ether, "Please pay exactly 0.01 ethers");
        require(block.timestamp < votingEndTime, "The voting session has ended.");
        require(!hasVoted[msg.sender], "You have already voted.");

        options[optionIndex].voteCount += 1;
        hasVoted[msg.sender] = true;
        voters.push(msg.sender);

        emit VotedCast(optionIndex);
    }

    function getVotingType() public pure returns (string memory) {
        return "Public";
    }
}

contracts/VotingCore.sol.content:
pragma solidity ^0.8.27;

abstract contract VotingCore {

    struct Option {
        string name;
        uint voteCount;
    }

    address public owner;
    address public creator;
    string public question;
    Option[5] public options;
    uint public votingEndTime;
    bool public isVotingActive;
    bool public withdrawn;

    event VotedCast(uint optionIndex);
    event VotingEnded();

    constructor(address _creator) {
        owner = msg.sender;
        creator = _creator;
        withdrawn = false;
    }

    function getResults() public view returns (string[] memory, uint[] memory) {
        string[] memory optionNames = new string[](options.length);
        uint[] memory voteCounts = new uint[](options.length);

        for (uint i = 0; i < options.length; i++) {
            optionNames[i] = options[i].name;
            voteCounts[i] = options[i].voteCount;
        }
        return (optionNames, voteCounts);
    }

    function withdraw() public {
        require(msg.sender == creator, "Only the owner can withdraw funds.");
        require(isVotingActive, "No active voting session.");
        require(withdrawn == false, "Funds already withdrawn.");

        uint balance = address(this).balance;
        if (balance > 0){
            payable(msg.sender).transfer(balance);
        }   
        withdrawn = true;
    }

    function endVoting() public {
        require(msg.sender == owner, "Only the owner can end the voting.");
        require(isVotingActive, "No active voting session.");
        require(withdrawn == true, "Funds needs to be withdrawn.");

        isVotingActive = false;
        emit VotingEnded();
    }

    function newVote(string memory _question, string[] memory optionNames, uint durationInMinutes) public {
        require(msg.sender == owner, "Only the owner can start voting session.");
        require(!isVotingActive, "The Session is still active");

        question = _question;
        votingEndTime = block.timestamp + (durationInMinutes * 1 minutes);

        for (uint i = 0; i < optionNames.length; i++) {
            options[i] = Option({ name: optionNames[i], voteCount: 0 });
        }

        isVotingActive = true;
    }

    function vote(uint optionIndex) public payable virtual;
}

contracts/VotingManager.sol.content:
pragma solidity ^0.8.27;

import "./AnonymousVoting.sol";
import "./PublicVoting.sol";

contract VotingManager{
    address public owner;
    address public publicVoting;
    address public anonymousVoting;
    address public activeVoting;
    bool private isAnonymousVoting;

    event VotingCreated(address votingContractAddress, bool isAnonymous);

    constructor(address _publicVoting, address _anonymousVoting) {
        owner = msg.sender;
        activeVoting = address(0);

        if (_publicVoting == address(0)) {
            publicVoting = address(new PublicVoting(msg.sender));
        } 
        else {
            publicVoting = _publicVoting;
        }

        if (_anonymousVoting == address(0)) {
            anonymousVoting = address(new AnonymousVoting(msg.sender));
        } 
        else {
            anonymousVoting = _anonymousVoting;
        }
    }

    function createVoting(
        bool isAnonymous, 
        string memory question, 
        string[] memory optionNames, 
        uint durationInMinutes
    ) public {
        require(msg.sender == owner, "Only the owner can create a new voting instance.");
        require(activeVoting == address(0), "A voting session is currently active.");
        isAnonymousVoting = isAnonymous;

        if (!isAnonymous){
            PublicVoting(publicVoting).newVote(question, optionNames, durationInMinutes); 
            PublicVoting(publicVoting).newVoting();
            activeVoting = publicVoting;

            emit VotingCreated(publicVoting, false);
        }
        else {
            AnonymousVoting(anonymousVoting).newVote(question, optionNames, durationInMinutes); 
            AnonymousVoting(anonymousVoting).newVoting();
            activeVoting = anonymousVoting;

            emit VotingCreated(anonymousVoting, true);
        }
    }

    function endActiveVoting() public {
        require(msg.sender == owner, "Only the owner can end the voting session.");
        require(activeVoting != address(0), "No active voting session");

        if (isAnonymousVoting){
            AnonymousVoting(activeVoting).endVoting(); 
        }
        else {
            PublicVoting(activeVoting).endVoting();
        }
        
        activeVoting = address(0);
    }
}

